import React, { useState, useEffect } from "react";
import axios from "axios";
import Navbar from "./Navbar";
import { Typography, Toolbar, Container, Grid } from "@mui/material";
import MovieCard from "./MovieCard";

function Home() {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    axios
      .get(
        `http://api.themoviedb.org/3/discover/movie?api_key=328c283cd27bd1877d9080ccb1604c91&primary_release_date.lte=2016-12-31&sort_by=release_date.desc&page=2`
      )
      .then((res) => {
        console.log("res:", res);
        const movies = res.data.results;
        setMovies(movies);
      });
  }, []);

  return (
    <div>
      <Navbar />
      <Toolbar />
      <Container>
        <Typography variant="h4">Homepage</Typography>
        <Grid container>
          <Grid item spacing={2}>
            <MovieCard movies={movies} />
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default Home;
